script: |
  super -f text -I q3286.spq | sort > q3286.out

inputs:
  - name: q3286.spq
    data: |
      SELECT DISTINCT - tab1.col1 * cor0.col1 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q3286.out
    data: |
      -1118
      -1183
      -1261
      -2236
      -2366
      -2522
      -860
      -910
      -970
